const atob = require('atob');

class Languages {
  constructor(lang) {
    this.lang = lang;
  }

  getLang() {
    let langs = JSON.parse(atob(''));
    return langs[this.lang];
  }

  getAllLangs() {
    let langs = JSON.parse(atob(''));
    return langs;
  }
}

module.exports = {
  Languages: Languages
};